import dayjs from 'dayjs';
import TextField from '@mui/material/TextField';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { StaticDatePicker } from '@mui/x-date-pickers/StaticDatePicker';

import {useEffect, useState} from 'react';
import { Card, Typography,Button } from "@mui/material";
function Time(){

function TimeSelect(){
  const [StartTime, setStartTime] = useState(dayjs(Date()).subtract(3,'year'));
  const [EndTime, setEndTime] = useState(dayjs(Date()));
  const [anchorE1, setanchorE1] = useState(null);
  const handleClick = (event)=>{
    setanchorE1(event.currentTarget);
  }
  function handleClose(){
    setanchorE1(null);
  }
  function SelectStartTime(){

    return (
     <LocalizationProvider dateAdapter={AdapterDayjs}>
        <StaticDatePicker
        displayStaticWrapperAs="desktop"
        value={StartTime}
        onChange={(newValue) => {
          setStartTime(newValue);
        }}
        renderInput={(params) => <TextField {...params} />}
        onClose={handleClose}
        maxDate={EndTime}
      />
   </LocalizationProvider>
  );
  }
  function SelectEndTime() {

    return (
     <LocalizationProvider dateAdapter={AdapterDayjs}>
        <StaticDatePicker
        displayStaticWrapperAs="desktop"
        value={EndTime}
        onChange={(newValue) => {
          setEndTime(newValue);
        }}
        renderInput={(params) => <TextField {...params} />}
        onClose={handleClose}
        minDate={StartTime}
        maxDate={Date()}
      />
   </LocalizationProvider>
  );
  }
  return (
      <Typography align="center">
        <Typography>{anchorE1===null?<Button onClick={handleClick}>{StartTime.get('year')}-{StartTime.get('month')}-{StartTime.get('dates')}</Button>:<SelectStartTime/>}</Typography>
        <Typography>-</Typography>
      </Typography>
  );
}
  return (
    <Card style={{height:"100%",width:"100%"}}>

      <TimeSelect/>
    </Card>
  );
}
export default Time;
